import React from 'react'
import s from './Dialogs.module.css'
import {NavLink} from "react-router-dom";


const DialogItem = (props) => {
    return (
        <NavLink to={'/dialogs/nikolai'} activeClassName={s.active}>
            {props.name}
        </NavLink>
    )
};
const Dialogs = (props) => {

    return (
        <div className={s.dialogs}>

            <div className={s.dialogItem}>
                Dialog

                <DialogItem name={'Nikolai'}/>

                <NavLink to={'/dialogs/petr'} activeClassName={s.active}>
                    Petr
                </NavLink>

                <NavLink to={'/dialogs/alexandr'} activeClassName={s.active}>
                    Alexandr
                </NavLink>

            </div>

            <div className={s.messages}>
                <div className={s.message}>Hi</div>

                <div className={s.message}>How are you</div>

                <div className={s.message}>I`m fine</div>
            </div>
        </div>
    )
};

export default Dialogs
